    const router = useNavigate()
    console.log(router)

    return (
        <div className="post">
            <div className="post__content">
                <strong>{props.post.id}. {props.post.title}</strong>
                <div>
                    {props.post.body}
                </div>
            </div>
            <div className="post__btns">
                <MyButton style={{ marginRight: "10px", marginLeft: "10px" }} Click={() => props.remove(props.post)}>
